[[package]]
category = "main"
description = "a version of dict that keeps keys in insertion resp. sorted order"
marker = "platform_python_implementation == \"CPython\" and python_version <= \"2.7\""
name = "ruamel.ordereddict"
optional = false
python-versions = "*"
